drop table callworktime;
drop table WORKTIME_DETAIL;
drop table WORKTIME;
drop table EMPLOYEE;
drop table HOLIDAY;

create table EMPLOYEE(
EMPNO varchar2(12) ,
NAME varchar2(30) NOT NULL,
POSITION varchar2(30) NOT NULL,
PASSWORD varchar2(16),
ID varchar2(15) NOT NULL,
EMAIL varchar2(50) NOT NULL,
BEGIN DATE DEFAULT (SYSDATE),
END DATE,
CONSTRAINT PK_EMPLOYEE_EMPNO PRIMARY KEY(EMPNO)
);

CREATE TABLE HOLIDAY(
CHANGE_DATE DATE,
STATUS VARCHAR2(15),
REASON VARCHAR2(150) NOT NULL,
HOURS NUMBER(1),
CONSTRAINT PK_HOLIDAY_CHANGE_DATE primary key(CHANGE_DATE),
CONSTRAINT CK_HOLIDAY_STATUS CHECK(STATUS='ORDINARYDAY' OR STATUS='HOLIDAY'  ),
CONSTRAINT CK_HOLIDAY_HOURS CHECK(HOURS<=8 AND HOURS>=0)
);




CREATE TABLE WORKTIME(
  EMPNO VARCHAR2(12),
  WEEK_FIRST_DAY DATE,
  STATUS varchar2(20),
  SUN_NORMAL number(1) DEFAULT 0,
  SUN_OVERTIME number(1) DEFAULT 0,
  MON_NORMAL number(1) DEFAULT 0,
  MON_OVERTIME number(1) DEFAULT 0,
  TUE_NORMAL number(1) DEFAULT 0,
  TUE_OVERTIME number(1) DEFAULT 0,
  WED_NORMAL number(1) DEFAULT 0,
  WED_OVERTIME number(1) DEFAULT 0,
  THU_NORMAL number(1) DEFAULT 0,
  THU_OVERTIME number(1) DEFAULT 0,
  FRI_NORMAL number(1) DEFAULT 0,
  FRI_OVERTIME number(1) DEFAULT 0,
  SAT_NORMAL number(1) DEFAULT 0,
  SAT_OVERTIME number(1) DEFAULT 0,
  NOT_PASS_REASON varchar2(900),
  DETAIL_ID varchar2(40),
  constraint PK_WORKTIME_ID_WEEK_FIRST_DAY primary key(EMPNO,WEEK_FIRST_DAY),
  constraint FK_WORKTIME_ID FOREIGN KEY(EMPNO) REFERENCES EMPLOYEE(EMPNO),
  constraint UK_WORKTIME_DETAIL_ID unique(DETAIL_ID),
  constraint CK_WORKTIME_SUN_NORMAL CHECK (SUN_NORMAL>=0 AND SUN_NORMAL<=8),
  constraint CK_WORKTIME_SUN_OVERTIME CHECK (SUN_OVERTIME>=0 AND SUN_OVERTIME<=4),
  constraint CK_WORKTIME_MON_NORMAL CHECK (MON_NORMAL>=0 AND MON_NORMAL<=8),
  constraint CK_WORKTIME_MON_OVERTIME CHECK (MON_OVERTIME>=0 AND MON_OVERTIME<=4),
  constraint CK_WORKTIME_TUE_NORMAL CHECK (TUE_NORMAL>=0 AND TUE_NORMAL<=8),
  constraint CK_WORKTIME_TUE_OVERTIME CHECK (TUE_OVERTIME>=0 AND TUE_OVERTIME<=4),
  constraint CK_WORKTIME_WED_NORMAL CHECK (WED_NORMAL>=0 AND WED_NORMAL<=8),
  constraint CK_WORKTIME_WED_OVERTIME CHECK (WED_OVERTIME>=0 AND WED_OVERTIME<=4),
  constraint CK_WORKTIME_THU_NORMAL CHECK (THU_NORMAL>=0 AND THU_NORMAL<=8),
  constraint CK_WORKTIME_THU_OVERTIME CHECK (THU_OVERTIME>=0 AND THU_OVERTIME<=4),
  constraint CK_WORKTIME_FRI_NORMAL CHECK (FRI_NORMAL>=0 AND FRI_NORMAL<=8),
  constraint CK_WORKTIME_FRI_OVERTIME CHECK (FRI_OVERTIME>=0 AND FRI_OVERTIME<=4),
  constraint CK_WORKTIME_SAT_NORMAL CHECK (SAT_NORMAL>=0 AND SAT_NORMAL<=8),
  constraint CK_WORKTIME_SAT_OVERTIME CHECK (SAT_OVERTIME>=0 AND SAT_OVERTIME<=4)
);


CREATE TABLE WORKTIME_DETAIL(
  DETAIL_ID varchar2(40),
  WORK_NAME varchar2(45),
  WORK_CONTENT varchar2(300) NOT NULL,
  SUN_NORMAL number(1) DEFAULT 0,
  SUN_OVERTIME number(1) DEFAULT 0,
  MON_NORMAL number(1) DEFAULT 0,
  MON_OVERTIME number(1) DEFAULT 0,
  TUE_NORMAL number(1) DEFAULT 0,
  TUE_OVERTIME number(1) DEFAULT 0,
  WED_NORMAL number(1) DEFAULT 0,
  WED_OVERTIME number(1) DEFAULT 0,
  THU_NORMAL number(1) DEFAULT 0,
  THU_OVERTIME number(1) DEFAULT 0,
  FRI_NORMAL number(1) DEFAULT 0,
  FRI_OVERTIME number(1) DEFAULT 0,
  SAT_NORMAL number(1) DEFAULT 0,
  SAT_OVERTIME number(1) DEFAULT 0,
  constraint PK_WORKTIME_DETAIL_DT_ID_PJ_ID primary key(DETAIL_ID,WORK_NAME),
  constraint FK_WORKTIME_DETAIL_DETAIL_ID FOREIGN KEY(DETAIL_ID) REFERENCES WORKTIME(DETAIL_ID),
  constraint CK_WORKTIME_DETAIL_SUN_NORMAL CHECK (SUN_NORMAL>=0 AND SUN_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_SUN_OT CHECK (SUN_OVERTIME>=0 AND SUN_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_MON_NORMAL CHECK (MON_NORMAL>=0 AND MON_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_MON_OT CHECK (MON_OVERTIME>=0 AND MON_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_TUE_NORMAL CHECK (TUE_NORMAL>=0 AND TUE_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_TUE_OT CHECK (TUE_OVERTIME>=0 AND TUE_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_WED_NORMAL CHECK (WED_NORMAL>=0 AND WED_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_WED_OT CHECK (WED_OVERTIME>=0 AND WED_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_THU_NORMAL CHECK (THU_NORMAL>=0 AND THU_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_THU_OT CHECK (THU_OVERTIME>=0 AND THU_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_FRI_NORMAL CHECK (FRI_NORMAL>=0 AND FRI_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_FRI_OT CHECK (FRI_OVERTIME>=0 AND FRI_OVERTIME<=4),
  constraint CK_WORKTIME_DETAIL_SAT_NORMAL CHECK (SAT_NORMAL>=0 AND SAT_NORMAL<=8),
  constraint CK_WORKTIME_DETAIL_SAT_OT CHECK (SAT_OVERTIME>=0 AND SAT_OVERTIME<=4)
);
